import React from "react";
import { FaTwitterSquare } from "react-icons/fa";

const CoreTeamMember = ({ member }) => {
  return (
    <div>
      <img src={member.img} alt="" />
      <p>{member.name}</p>
      <p>{member.post}</p>
      <p>{member.skill}</p>
      <p><a href=""><Fat/></a></p>
    </div>
  );
};

export default CoreTeamMember;
